import React from 'react';
import './Recipe.css'; 

const Recipe = (props) => {
    return(
        <div className="container"> 
            <div className="recipeStyle">
                <p>  {props.recipeName} </p>
                <img src={"https://spoonacular.com/recipeImages/"+props.recipeID+"-480x360"+".jpg"}/>  
            </div>
        </div>
    )
}

export default Recipe;
